  [],\n\t\"revision_timestamp\": \"2016-07-27T22:25:05.935040\",\n\t\"name\": \"hawaiian-islands-national-wildlife-refuge-master-plan-environmental-impact-statement\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Proposed is a management plan and accompanying
  EIS for the Hawaiian Islands National Wildlife Refuge. The plan places primary emphasis
  on protecting and enhancing Refuge wildlife resources, particularly threatened and
  endangered species. The plan would also accommodate limited forms of public use
  such as wildlife interpretation and environmental education. Additionally the plan
  would support various compatible public and economic uses throughout the Northwestern
  Hawaiian Islands archipelago (e.g., commercial fishing outside the refuge boundary).
  Five alternatives were considered, each composed of different mixes of conservation
  and public use strategies. The proposed action is a hybrid that would optimally
  satisfy all refuge objectives. It is the opinion of the U.S. Fish and Wildlife Service,
  following a January 10, 1985 internal consultation under Section 7 of the Endangered
  Species Act of 1973, that adoption and implementation of any of the alternatives
  considered would promote conservation of the six species of endangered or threatened
  wildlife addressed in this document. Furthermore, on April 8, 1986 the National
  Marine Fisheries Service (NMFS) completed a separate biological consultation under
  Section 7 of the Endangered Species Act (NMFS shares responsibility for the management
  of threatened green sea turtle and endangered Hawaiian monk seal populations with
  the U.S. Fish and Wildlife Service) and has concluded that implementation of the
  revised, final Master Plan/EIS Preferred Alternative is not likely to jeopardize
  the continued existence of the Hawaiian monk seal or the Hawaiian green sea turtle.\",\n\t\"license_title\":
